import { React, useEffect, useState } from "react";
import axios from "axios";

const Kategorije = () => {
  const [data, setData] = useState({ lista: [] });

  useEffect(async () => {
    const result = await axios.get("http://localhost:5000/kategorije/");

    setData(result.data);
  }, []);
  console.log(data);
  return !data.length ? <h1>Nema</h1> : <h1>{data.lista.naziv}</h1>;
};

export default Kategorije;
